import React from 'react'
import {Jumbotron, Button} from 'react-bootstrap'

function Notes() {
  return (
    <Jumbotron>
      <h1>Minhas Anotações</h1>
      <p>Usa a janela para adicionar anotações!</p>
    </Jumbotron>
  )
}

export default Notes
